/* fonts */
export const FontFamily = {
  latoBold: "Lato-Bold",
  latoRegular: "Lato-Regular",
  h600SemiBold: "Poppins-SemiBold",
  h300Regular: "Poppins-Regular",
  h500Meduim: "Poppins-Medium",
  sFSubheadlineSemibold: "SF Pro Text",
};
/* font sizes */
export const FontSize = {
  size_sm: 14,
  h600SemiBold_size: 20,
  h300Regular_size: 12,
  h500Meduim_size: 16,
  sFSubheadlineSemibold_size: 15,
};
/* Colors */
export const Color = {
  dailyplusGreen: "#5ec401",
  darkgray: "#a5a7b9",
